def find_kth_element(arr1, arr2, k):
    import heapq
    merged = []
    heap = []
    for i, num in enumerate(arr1):
        heapq.heappush(heap, (num, i, 0))
    for i, num in enumerate(arr2):
        heapq.heappush(heap, (num, 0, i))
    while heap:
        val, idx1, idx2 = heapq.heappop(heap)
        merged.append(val)
        if len(merged) == k:
            return val
        if idx1 + 1 < len(arr1):
            heapq.heappush(heap, (arr1[idx1 + 1], idx1 + 1, idx2))
        if idx2 + 1 < len(arr2):
